import React, { Component } from 'react';
import { Link } from 'react-router-dom';
class WishlistCard extends Component {
    render() {
        return (
            <div className="Card">
                <h3>Name of Game</h3>
                <h5>Name of Company</h5>
                 Best Price
                <Link>Game Page</Link>
            </div>
        );
    }
}

export default WishlistCard;
